import useForm from './hooks/useForm';
import Input from './components/Input';

const App = () => {
  const [form, handleChange] = useForm({
    name: '',
    lastname: '',
    email: ''
  })
  return (
    <form>
      <Input
        label='Name'
        name='name'
        value={form.name}
        onChange={handleChange} />
      <Input
        label='Last name'
        name='lastname'
        value={form.lastname}
        onChange={handleChange} />
      <Input
        label='Email'
        name='email'
        value={form.email}
        onChange={handleChange} />
    </form>
  );
}

export default App;
